        twitterTitle: '',
        twitterDescription: '',
        twitterCard: 'summary_large_image',
    })

    const tooltipStyle = ref({
        left: '0px',
        top: '0px',
        visibility: 'hidden',
    });

    const pathElement = ref(null);
    const svgContainer = ref(null);
    const tooltip = ref(null);
    const iso2 = ref(null);
    const country = ref(null);
    const location = ref(null);

    const updateTooltipPosition = (event) => {
        if (!svgContainer.value || !tooltip.value) return;

        const pathElement = event.target;
        iso2.value = pathElement.getAttribute('iso2');
        country.value = pathElement.getAttribute('country');
        location.value = pathElement.getAttribute('location');

        // Use a timeout to allow the DOM to update
        setTimeout(() => {
            tooltipStyle.value.visibility = 'visible';
            const svgRect = svgContainer.value.getBoundingClientRect();
            const pathRect = event.target.getBoundingClientRect();
            const tooltipRect = tooltip.value.getBoundingClientRect();

            // Calculate position relative to the SVG container
            const x = pathRect.left - svgRect.left - (tooltipRect.width / 2) + 3;
            const y = pathRect.top - svgRect.top - tooltipRect.height - 16;

            tooltipStyle.value = {
                left: `${x}px`,
                top: `${y}px`,
                visibility: 'visible',
            };
        }, 100);
    };

    const hideTooltip = () => {
        tooltipStyle.value = {
            left: '0px',
            top: '0px',
            visibility: 'hidden',
        };
    };

